import React from "react";
import styled from "styled-components";
import { Link } from 'react-router-dom';

const Nav = () => {



    return (
        <StyledNav>
            <h1><a id="logo" href="#">Capture</a></h1>
            <ul>
                <li>
                    <Link id="logo" to="/">1.About us</Link>
                </li>
                <li>
                    <Link id="logo" to="/">1.About us</Link>
                </li>
                <li>
                    <Link id="logo" to="/">1.About us</Link>
                </li>
            </ul>
        </StyledNav>
    )
}

const StyledNav = styled.nav`
    min-height: 10vh;
    display: flex;
    margin: auto;
    justify-content: space-between;
    align-items:center;
    padding:1rem 10rem;
    background-color: #282828;

    a{
        color: white;
        text-decoration:none;
    }
    ul{
        list-style: none;
        display:flex;
    }

    #logo{
        font-size:1.5rem;
        font-family:"Lobster", cursive;
        font-weight: lighter;
    }
    li{
        padding-left:10rem;
        position: relative;
    }
`;

export default Nav;
